assignments.value:
={{ 
  $json.review_author.map((review_author, idx) => ({
    review_author,
    review_author_reviews_count: $json.review_author_reviews_count[idx].replace(' reviews', '').toInt(),
    review_country: $json.review_country[idx],
    review_date: $json.review_date[idx].toDate(),
    review_date_of_experience: $json.review_date_of_experience[idx].replace('Date of experience: ', '').toDate(),
    review_rating: $json.review_rating[idx].toInt(),
    review_text: $json.review_text[idx],
    review_title: $json.review_title[idx],
    review_url: $('Get TrustPilot Page').params.url.match(/https:\/\/[^/]+/) + $json.review_url[idx],
  }))
}}

parameters.jsonOutput:
={{ {
  ...$json.output,
  "CompanyID": $('Set Variables1').item.json.companyId,
  "From": $('Set Variables1').item.json.review_date_from,
  "To": $('Set Variables1').item.json.review_date_to,
  "Number of Responses": $('Get Payload of Points').item.json.result.length,
  "Raw Responses": $('Get Payload of Points').item.json.result.map(item =>
    [
      item.payload.metadata.review_date,
      item.payload.metadata.review_author,
      item.payload.metadata.review_rating,
      item.payload.content.replaceAll('"', '\"').replaceAll('\n', ' '),
      item.payload.metadata.review_url,
    ]
   ).join('\n')
} }}
